import {instanse} from './api'

type GetCaptchaUrlType = {
    url:string
}

export const securityAPI = {
    getCaptchaUrl() {
        return instanse.get<GetCaptchaUrlType>(`security/get-captcha-url`).then(res =>res.data)
    },
}
